pragma solidity ^0.5.16;

contract AeroplaneChess{
    struct Player{
        string color;
        string state;
    }
   uint8 id;
   string[4] colorList=["red","blue","yellow","green"];
   
   Player[] public player_list;
   
   constructor()public{}
   
   function _addNewUser(string memory color,string memory state)public{
       player_list.push(Player(color,state));
   }
   
}
